webstoreListingDescription.message:
Installera AudD-tillägget och klicka på dess ikon för att identifiera låten som spelas på den aktuella fliken.
Se videon ovan för att se hur det fungerar.

AudD-tillägg:
- Känner igen musiken som spelas i din webbläsare;
- Hittar musik i AudD-databasen med mer än 75 miljoner låtar med hjälp av dess musikigenkänningsteknik;
- Visar texter för identifierade låtar;
- Visar länkar för att lyssna på låtarna på Apple Music, Spotify, Deezer, YouTube Music;
- Visar det exakta ögonblicket i den igenkända låten när ljudet från webbläsaren spelas upp.

Music Recognition API: https://audd.io
Källkod: https://github.com/AudDMusic/chrome-extension

Tillägg som drivs av AudD® Music recognition API

Skapad och designad av AudD.io-teamet med hjälp av Eric Stark, Mitchell Kossoris och Ivan Kasatkin.
